import React from "react";
import { Row, Col, Container, Jumbotron, Toast } from "react-bootstrap";

const StudentMatters = (temperatureMatter) => {
  const temperatureMatterArray = temperatureMatter.temperatureMatter;
  return (
    <Container className="student-matters text-center" fluid>
      <h3 style={{ color: "white", textAlign: "left" }}>Student Matters</h3>
      <Row>
        <Col>
          <Jumbotron
            style={{
              backgroundColor: "white",
              width: "auto",
              height: "auto",
            }}
          >
            <h3>High Temperature</h3>
          </Jumbotron>
          {temperatureMatterArray.map((result) => {
            return (
              <Toast>
                <Toast.Header>
                  <img
                    src="holder.js/20x20?text=%20"
                    className="rounded mr-2"
                    alt=""
                  />
                  <strong className="mr-auto">Bootstrap</strong>
                  <small>11 mins ago</small>
                </Toast.Header>
                <Toast.Body>Hello, world! This is a toast message.</Toast.Body>
              </Toast>
            );
          })}
        </Col>
      </Row>
      <Row>
        <Col>
          <Jumbotron
            style={{
              backgroundColor: "white",
              width: "auto",
              height: "auto",
            }}
          >
            <h3>Low Attendance</h3>
          </Jumbotron>
        </Col>
      </Row>
    </Container>
  );
};

export default StudentMatters;
